  true,\n\t\"url\": null,\n\t\"notes\": \"The 2010 National Survey of Veterans (NSV)
  is the sixth in a series of comprehensive nationwide surveys designed to help the
  Department of Veterans Affairs (VA) plan its future programs and services for Veterans.
  It also provides a snapshot profile of the Veteran population. Data collected through
  the NSV enables VA to: follow changing trends in the Veteran population; compare
  characteristics of Veterans who use VA benefits and services with those of Veterans
  who do not; study VAu00efu00bfu00bds role in the delivery of all benefits and services
  that Veterans receive; and update information about Veterans to help the Department
  develop its policies.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
